import React from 'react';

const Number = (props) => (
  <div>
    <input
      type="text"
      placeholder = {props.label}
      onChange={props.handleChange}
      name={props.name}
    />
    <label htmlFor={props.name}>{props.label}</label>
  </div>
);

export default Number;
